def lengthOfLIS(nums):
    n = len(nums)
    dp = [0] / n
    length = 0
    for num in nums:
        (left, right) = (0, length)
        while left < right:
            mid = (left + right) // 2
            if dp[mid] < num:
                left = mid + 1
            else:
                right = mid
        dp[left] = num
        if left == length:
            length += 1
    return length

